import React, {useState} from 'react';
import Carousel from '@brainhubeu/react-carousel';
import '@brainhubeu/react-carousel/lib/style.css';
import '../styles/App.scss';
import '../styles/SliderInstructors.scss';

const  SliderInstructors = () => {
    const [value, setValue] = useState(0);

    const onChange = value => {
    setValue(value);
    }

    return(
        <>
            <h1>Slider Prueba</h1>
            <br></br>
            <div>
      <Carousel
        value={value}
        onChange={onChange}
      >
        <img className="img-example" src={someImage} />
        ...
        <img className="img-example" src={anotherImage} />
      </Carousel>
      <Dots
        value={this.state.value}
        onChange={this.onChange}
        thumbnails={[
          (<img key={1} className="img-example-small" src={abstractImage} />),
          ...
          (<img key={12} className="img-example-small" src={transportImage} />),
        ]}
      />
            </div>
        </>
    )
}

export default SliderInstructors;
